@import url('https://fonts.googleapis.com/css2?family=Raleway:wght@300;400;500;600&display=swap');

* {
    padding: 0;
    margin: 0;
    box-sizing: border-box;
}

/* clearfix*/
.clearfix::after {
    content: "";
    display: block;
    clear: both;
}

html {
    scroll-behavior: smooth;
}

body {
    background-color: rgb(255, 242, 231);
    font-family: 'Raleway', sans-serif;
}

/* CZEŚĆ! */
header {
    position: relative;
    min-height: 72vh;
    background-image: url("/5fcbc9efa80e7a45c815ba972ed9ac67.jpg");
    background-attachment: fixed;
    background-repeat: no-repeat;
    background-size: cover;
    background-position: top 0% left 85%;
    filter: brightness(0.85);
}

header p {
    position: absolute;
    width: 100%;
    bottom: 50%;
    transform: translateY(50%);
    color: white;
    font-family: 'Roboto', sans-serif;
    text-align: center;
    font-size: 32vh;
    font-weight: 500;
    animation: move 4s ease 1;
}

@keyframes move {
    0% {
        opacity: 0;
        left: 0;
    }

    5% {
        opacity: 0;
        left: 0;
    }

    10% {
        opacity: 0;
        letter-spacing: 35px;
    }

    30% {
        opacity: 0.7;
        letter-spacing: 20px;
    }

    100% {
        opacity: 1;
    }
}

header i {
    position: absolute;
    /* padding: 4px; */
    right: 1.3vh;
    bottom: calc(3.5vh - 0.8vh);
    transform: translateY(50%);
    font-size: 4vh;
    color: white;
    text-shadow: 0 -1.5vh 0 white;
    animation: scroll 3s 6s linear infinite;
}

@keyframes scroll {
    0% {
        right: 1.3vh;
    }

    1% {
        right: 0.9vh;
    }

    2% {
        right: 1.7vh;
    }

    4% {
        right: 0.9vh;
    }

    6% {
        right: 1.7vh;
    }

    8% {
        right: 0.9vh;
    }

    10% {
        right: 1.7vh;
    }

    12% {
        right: 0.9vh;
    }

    14% {
        right: 1.7vh;
    }

    15% {
        right: 1.3vh;
    }

    100% {
        right: 1.3vh;
    }
}

/*NAWIGACJA*/
nav {
    display: flex;
    justify-content: center;
    position: relative;
    margin-top: -7vh;
    margin-bottom: 3vh;
    height: 7vh;
    background-color: rgba(26, 22, 19, 0.7);
}

nav ul {
    display: flex;
    height: 100%;
    list-style: none;
    font-size: 0;
    width: 100%;
    max-width: 1024px;
}

nav ul li {
    width: 33.3%;
    text-align: center;
}

nav ul li a {
    display: block;
    color: white;
    line-height: 7vh;
    font-size: 5vh;
    text-decoration: none;
    letter-spacing: 1px;
    opacity: 0.7;
    transition: 0.3s;
}

nav ul li:hover a {
    transform: scale(1.1);
    opacity: 1;
    color: white;
}

/*O MNIE*/
#description {
    position: relative;
    display: flex;
    width: 92.5%;
    margin-left: 7.5%;
    margin-bottom: 20px;
}

#description img {
    display: block;
    height: 22vh;
    border: 2px solid rgba(0, 0, 0, 0.2);
    margin-right: 40px;
    opacity: 0.9;
    float: left;
}

#description div {
    width: 100%;
    position: relative;
    float: left;
}

#description p {
    display: block;
    box-sizing: border-box;
    width: 86%;
    color: #1a1613;
    padding: 12px 0;
    font-size: 28px;
    line-height: 1.4;
    animation: show 3s 0.8s ease 1 both;
    left: 0;
}

@keyframes show {
    0% {
        left: 100%;
        opacity: 0;
    }

    50% {
        opacity: 0.3;
    }

    80% {
        left: 0;
        /* opacity: 1; */
    }

    100% {
        opacity: 1
    }
}

#description span {
    display: block;
    padding-top: 15px;
}

/*przekierwoanie do HOBBY*/
#to-hobby a {
    display: block;
    position: relative;
    width: 26%;
