@import url('https://fonts.googleapis.com/css2?family=Roboto:wght@300&display=swap');

@import url('https://fonts.googleapis.com/css2?family=Raleway:wght@300;400;500;600&display=swap');

* {
    padding: 0;
    margin: 0;
    box-sizing: border-box;
}

/* clearfix*/
.clearfix::after {
    content: "";
    display: block;
    clear: both;
}

html {
    scroll-behavior: smooth;
}

body {
    background-color: rgb(255, 242, 231);
    font-family: 'Raleway', sans-serif;
}

/* CZEŚĆ! */
header {
    position: relative;
    min-height: 72vh;
    background-image: url("img/02.jpg");
    background-attachment: fixed;
    background-repeat: no-repeat;
    background-size: cover;
    background-position: top 0% left 85%;
    filter: brightness(0.85);
}

header p {
    position: absolute;
    width: 100%;
    bottom: 50%;
    transform: translateY(50%);
    color: white;
    font-family: 'Roboto', sans-serif;
    text-align: center;
    font-size: 32vh;
    font-weight: 500;
    animation: move 4s ease 1;
}

@keyframes move {
    0% {
        opacity: 0;
        left: 0;
    }

    5% {
        opacity: 0;
        left: 0;
    }

    10% {
        opacity: 0;
        letter-spacing: 35px;
    }

    30% {
        opacity: 0.7;
        letter-spacing: 20px;
    }

    100% {
        opacity: 1;
    }
}

header i {
    position: absolute;
    /* padding: 4px; */
    right: 1.3vh;
    bottom: calc(3.5vh - 0.8vh);
    transform: translateY(50%);
    font-size: 4vh;
    color: white;
    text-shadow: 0 -1.5vh 0 white;
    animation: scroll 3s 6s linear infinite;
}

@keyframes scroll {
    0% {
        right: 1.3vh;
    }

    1% {
        right: 0.9vh;
    }

    2% {
        right: 1.7vh;
    }

    4% {
        right: 0.9vh;
    }

    6% {
        right: 1.7vh;
    }

    8% {
        right: 0.9vh;
    }

    10% {
        right: 1.7vh;
    }

    12% {
        right: 0.9vh;
    }

    14% {
        right: 1.7vh;
    }

    15% {
        right: 1.3vh;
    }

    100% {
        right: 1.3vh;
    }
}

/*NAWIGACJA*/
nav {
    display: flex;
    justify-content: center;
    position: relative;
    margin-top: -7vh;
    margin-bottom: 3vh;
    height: 7vh;
    background-color: rgba(26, 22, 19, 0.7);
}

nav ul {
    display: flex;
    height: 100%;
    list-style: none;
    font-size: 0;
    width: 100%;
    max-width: 1024px;
}

nav ul li {
    width: 33.3%;
    text-align: center;
}

nav ul li a {
    display: block;
    color: white;
    line-height: 7vh;
    font-size: 5vh;
    text-decoration: none;
    letter-spacing: 1px;
    opacity: 0.7;
    transition: 0.3s;
}

nav ul li:hover a {
    transform: scale(1.1);
    opacity: 1;
    color: white;
}

/*O MNIE*/
#description {
    position: relative;
    display: flex;
    width: 92.5%;
    margin-left: 7.5%;
    margin-bottom: 20px;
}

#description img {
    display: block;
    height: 22vh;
    border: 2px solid rgba(0, 0, 0, 0.2);
    margin-right: 40px;
    opacity: 0.9;
    float: left;
}

#description div {
    width: 100%;
    position: relative;
    float: left;
}

#description p {
    display: block;
    box-sizing: border-box;
    width: 86%;
    color: #1a1613;
    padding: 12px 0;
    font-size: 28px;
    line-height: 1.4;
    animation: show 3s 0.8s ease 1 both;
    left: 0;
}

@keyframes show {
    0% {
        left: 100%;
        opacity: 0;
    }

    50% {
        opacity: 0.3;
    }

    80% {
        left: 0;
        /* opacity: 1; */
    }

    100% {
        opacity: 1
    }
}

#description span {
    display: block;
    padding-top: 15px;
}

/*przekierwoanie do HOBBY*/
#to-hobby a {
    display: block;
    position: relative;
    width: 26%;
    bottom: 5.5vh;
    padding-left: 2.5%;
    color: rgba(0, 0, 0, 0.589);
    background-color: rgba(116, 79, 58, 0.20);
    float: right;
    transition: 0.6s;
    /* do a */
    list-style: none;
    text-decoration: none;

    height: 4vh;
    line-height: 4vh;
    font-size: 28px;
    letter-spacing: 1px;
}

#to-hobby a:hover {
    width: 30%;
    letter-spacing: 2px;
    background-color: rgba(116, 79, 58, 0.15);
    color: rgba(0, 0, 0, 0.8);
}

/* MOJE NAJLEPSZE PROJEKTY */
#projects {
    margin: 0 auto;
    margin-bottom: 35px;
}

#projects p {
    display: block;
    width: 40%;
    padding: 30px 0;
    padding-top: 20px;
    letter-spacing: 2px;
    text-align: center;
    font-weight: 400;
    font-size: 35px;
    margin: 0 auto;
}

#projects p.opis {
    border-bottom: 2px solid black;
}

.project {
    display: flex;
    align-items: center;
    flex-direction: row;
    width: 85%;
    margin: 40px auto;
    margin-bottom: 60px;
    /* overflow: hidden; */
    height: 23vh;
}

#projects .project .project-description p {
    display: block;
    width: 100%;
    box-sizing: border-box;
    text-align: left;
    letter-spacing: 0;
    padding-right: 10px;
    padding-left: 2vw;
    color: #1a1613;
    font-size: 30px;
    line-height: 1.3;
    overflow-wrap: break-word;
}

#projects .project .right p {
    text-align: right;
    padding-right: 2vw;
    margin-left: 0;
}

#projects .project .project-description h3 {
    display: block;
    box-sizing: border-box;
    text-align: left;
    margin-left: 2vw;
    color: black;
    letter-spacing: 4px;
    line-height: 1.2;
    font-size: 32px;
}

#projects .project .right h3 {
    text-align: right;
    margin-right: 2vw;
}

.project img {
    display: block;
    height: 100%;
    opacity: 0.75;
    transition: 0.4s;
}

.project:hover img {
    opacity: 0.5;
    transform: scale(1.1);
}

/* hobby */
#hobby .container {
    width: 100%;
    padding: 50px 5%;
    padding-top: 30px;
    padding-bottom: 80px;
    margin: 0 auto;
    font-size: 0;
}

.container p {
    margin-top: 20px;
    margin-bottom: 20px;
    letter-spacing: 3px;
    font-weight: 290;
    font-size: 40px;
}

.activity {
    display: inline-block;
    position: relative;
    width: 33.3%;
}

.activity img {
    display: block;
    padding: 0 2%;
    margin: 0 auto;
    opacity: 0.9;
    filter: grayscale(0.4);
    transition: 0.7s;
    width: 100%;
}

.activity img:hover {
    filter: grayscale(0);
    opacity: 1;
}

.activity p {
    display: block;
    position: absolute;
    width: 100%;
    padding: 0 2%;
    margin: 0 auto;
    bottom: 68%;
    text-align: center;
    color: rgba(0, 0, 0, 0);
    transform: scale(1.1);
    transition: 0.7s;
    font-size: 30px;
}

.activity:hover p {
    color: rgba(255, 255, 255, 0.65);
    font-weight: 200;
    opacity: 1;

    letter-spacing: 4px;
}

.pic1:hover p {
    color: rgba(0, 0, 0, 0.678);
}

/* STOPKA */
/* kontatk */

footer {
    width: 100%;
    /* background-color: rgb(214, 172, 105); */
    /* background-color: rgba(16, 58, 71, 0.753); */
    /* background-color: rgba(68, 11, 11, 0.75); */
    background-color: rgba(2, 31, 17, 0.719);
    /* background-color: rgba(65, 30, 9, 0.363); */
}

footer #contact {
    display: flex;
    flex-direction: column;
}

footer #contact .wrap {
    display: flex;
    flex-direction: column;
    width: 85%;
    align-items: flex-start;
    margin-left: 15%;
}

footer #contact .wrap .FormAndCon {
    display: flex;
    width: 100%;
}

footer #contact .wrap p {
    display: block;
    padding-top: 40px;
    padding-bottom: 20px;
    color: rgba(255, 255, 255, 0.8);
    opacity: 0.6;
    font-size: 40px;
    font-weight: bold;
    letter-spacing: 3px;
}

#contact .wrap form {
    margin-top: 2%;
    width: 45%;
    font-family: 'Raleway', sans-serif;
}

#contact .wrap form input {
    width: 100%;
    margin-bottom: 25px;
    font-family: 'Raleway', sans-serif;
    font-size: 18px;
    height: 30px;
    padding: 3px;
}

#contact .wrap form input:focus {
    background-color: rgba(255, 224, 167, 0.616);
}


#contact .wrap form textarea {
    width: 100%;
    margin-bottom: 25px;
    font-family: 'Raleway', sans-serif;
    font-size: 18px;
    height: 180px;
    padding: 3px;
}

#contact .wrap form button {
    position: relative;
    display: block;
    width: 55%;
    margin-bottom: 25px;
    font-family: 'Raleway', sans-serif;
    margin: 0 auto;
    height: 35px;
    font-size: 16px;
    font-weight: 400;
    border: 0px solid rgba(2, 31, 17, 0.7);
    overflow: hidden;
    letter-spacing: 2px;
    font-weight: 500;
}

#contact .wrap form button:hover {
    transition: 1s;
    letter-spacing: 3px;
    cursor: pointer;
}

#contact .wrap form button::after {
    content: "";
    position: absolute;
    height: 100%;
    width: 100%;
    color: black;
    background-color: rgba(245, 222, 179, 0.87);
    /* background-color: rgba(0, 98, 29, 0.4); */
