    color: wheat;
    transition: 0.3s;
    transform: scale(1.1);
}

#contact .wrap .con .icon:hover p {
    color: rgb(214, 172, 105);
    letter-spacing: 5px;
}

#contact .wrap .con .icon:hover i {
    transform: scale(1.1);
}

footer p.copyright {
    display: block;
